INSERT INTO `lck_post` VALUES (1, '15 ý tưởng quà tặng cho học sinh sắp trưởng thành', '15-y-tuong-qua-tang-cho-hoc-sinh-sap-truong-thanh', 'Whether for high school or college graduation, we’ve rounded up 15 creative graduation gift ideas to help you honor their milestone, through photos.', '<p><b><em>A note on the times:&nbsp;</em></b><em>This season of transition is likely looking very different than expected — especially for recent grads. However, students are still preparing to move on to the next phase of life, in whatever form that chapter may take. We hope this list provides inspiration for how to celebrate them and all they’ve accomplished, even if walking across the stage isn’t an option right now.</em></p>\r\n\r\n<p><br />\r\n&nbsp;</p>\r\n\r\n<p>Diploma? Check. Well-wishes? Check. Now for the celebration.<br />\r\n<br />\r\nGraduation marks a significant transition — the end of one season and the beginning of a new one. Reaching this point takes hard work and dedication, with many meaningful memories made along the way. Amidst so many years and accomplishments to celebrate, you may find yourself wondering what to gift a graduate to honor this momentous time.<br />\r\n<br />\r\nWe believe the most thoughtful gifts are ones that help us recognize and relive past experiences together. So whether for high school or college graduation, we’ve rounded up 15 creative graduation gift ideas to honor this milestone, through photos.</p>', 137, NULL, NULL, NULL, 142, 1, NULL, NULL, NULL, 0, NULL, NULL, NULL, 1, '2019-01-15 15:40:26', '2020-11-06 10:05:38', NULL, 1);
INSERT INTO `lck_post` VALUES (2, '8 Ý tưởng và Lựa chọn Thay thế Sách Lưu bút Đám cưới', '8-y-tuong-va-lua-chon-thay-the-sach-luu-but-dam-cuoi', 'We\'re sharing our favorite ways to let friends and family leave well-wishes and wisdom on your big day — all using photos, of course.', '<p>When it comes to remembering the details of your big day, you\'ll find that it\'s most often the people who surround you that make it most unforgettable. There\'s no better way to include and look back on friends and family than by featuring one of these wedding guest book ideas for them to sign, leaving a little piece of wisdom or a well wish for your future together. We\'ve seen many unique wedding guest book alternatives and uses for our own product collection and more — so here, we share some for your inspiration.</p>\r\n\r\n<div class=\"ddict_btn\" style=\"top: 96px; left: 862px;\"><img src=\"chrome-extension://bpggmmljdiliancllaapiggllnkbjocb/icon/16.png\" /></div>', 138, NULL, NULL, NULL, 207, 1, NULL, NULL, NULL, 0, NULL, NULL, NULL, 1, '2019-04-02 09:23:15', '2020-11-20 17:45:08', NULL, 1);
INSERT INTO `lck_post` VALUES (4, 'Album Layflat Chữ ký', 'album-layflat-chu-ky', 'New to our photo book family, the Signature Layflat Album is our most premium and personalized option, complete with a story all its own.', '<p>The newest addition to our line of photo books, the&nbsp;<a href=\"https://www.artifactuprising.com/photo-books/signature-layflat-photo-album\" target=\"_blank\">Signature Layflat Album</a>&nbsp;is the most premium and personalized option available — within our collection, and we believe, beyond. Made to honor your most meaningful occasions, from weddings to family milestones, this album answers to top customer-requested features, while bringing even more elevated details into the fold.<br />\r\n<br />\r\nInside and out, the materials chosen to make up this album are sourced with respect for our environment, and handled with care by real humans right here in the USA. From recycled leathers to time-honored binding techniques, the craftsmanship of our Signature Layflat Album honors what’s most meaningful to you, in print. Here, we’ll highlight all that goes into making this photo book truly one of a kind.</p>', 139, NULL, NULL, NULL, 130, 1, NULL, NULL, NULL, 0, NULL, NULL, NULL, 1, '2019-01-15 15:40:26', '2020-11-02 14:24:55', NULL, 1);
INSERT INTO `lck_post` VALUES (5, '10 món quà ý nghĩa cho bố nhân ngày của bố', '10-mon-qua-y-nghia-cho-bo-nhan-ngay-cua-bo', 'We\'ve gathered some of our most unique Father\'s Day gift ideas to help you celebrate those who mean \"Dad\" to you — because photos say it all.', '<p>From their wisdom, we take knowledge. From their courage, we take strength. And from their kindness, we take compassion. It is these endless lessons and unconditional love, shared by our father figures, that help shape us into the humans we become. On June 21, we pause to honor dads, mentors, big brothers, and beyond, saying thanks for the training wheels removed, laughter shared, and adventures still to come.<br />\r\n<br />\r\nHere, we\'ve gathered 10 unique Father\'s Day gift ideas to help you celebrate those who mean \"Dad\" to you — showing them just how much they\'re appreciated, through photo.</p>', 140, NULL, NULL, NULL, 158, 1, NULL, NULL, NULL, 0, NULL, NULL, NULL, 1, '2019-04-02 09:23:15', '2020-11-12 16:37:08', NULL, 1);
INSERT INTO `lck_post` VALUES (6, 'Cơn sốt đất ở Vân Đồn: Có hay không chuyện cò đất kiếm 1 tỷ/ ngày?', 'con-sot-dat-o-van-don-co-hay-khong-chuyen-co-dat-kiem-1-ty-ngay', 'Trong những ngày đầu tháng 3 đến nay, thị trường BĐS chiêm ngưỡng một cơn sốt đất chưa hề có tại Vân Đồn – Quảng Ninh. Liên tục nhưng khu đật được phân lô, sang nền và được các “cò đất” nâng giá lên tới mức kỷ lục. “Cò đất” còn kháo nhau, có những “cò” chuyên nghiệp, kiếm tới 1 tỷ đồng/ ngày.', '<h2><strong>Giá đất tăng từng ngày</strong></h2>\r\n\r\n<p>Thông tin về tình hình giao dịch đất đai sôi động tại&nbsp;Vân Đồn, tỉnh Quảng Ninh bắt đầu từ đầu năm 2019, ngay sau quyết định của tỉnh cho phép mở cửa giao dịch lại một số dự án tại địa phương này.</p>\r\n\r\n<p>Theo đó, từ ngày 9-1-2019, UBND huyện Vân Đồn đã chính thức tiếp nhận hồ sơ về việc giải quyết thủ tục hành chính về đất đai trên địa bàn, cho phép giao dịch mua bán quyền sử dụng đất đai đối với những trường hợp đủ điều kiện theo quy định pháp luật.</p>\r\n\r\n<figure aria-describedby=\"caption-attachment-29603\" id=\"attachment_29603\"><img alt=\"\" height=\"506\" sizes=\"(max-width: 900px) 100vw, 900px\" src=\"https://news.mogi.vn/wp-content/uploads/2019/03/con-so-dat-V%C4%90-1.png\" srcset=\"https://news.mogi.vn/wp-content/uploads/2019/03/con-so-dat-VĐ-1.png 900w, https://news.mogi.vn/wp-content/uploads/2019/03/con-so-dat-VĐ-1-300x169.png 300w, https://news.mogi.vn/wp-content/uploads/2019/03/con-so-dat-VĐ-1-768x432.png 768w, https://news.mogi.vn/wp-content/uploads/2019/03/con-so-dat-VĐ-1-696x391.png 696w, https://news.mogi.vn/wp-content/uploads/2019/03/con-so-dat-VĐ-1-747x420.png 747w\" width=\"900\" />\r\n<figcaption id=\"caption-attachment-29603\">Tỉnh Quảng Ninh “mở cửa” cho các giao dịch mua bán quyền sử dụng đất tại Vân Đồn.</figcaption>\r\n</figure>\r\n\r\n<p>Cùng với việc nhiều dự án hạ tầng giao thông lớn tại Quảng Ninh, đặc biệt là sân bay Vân Đồn đi vào hoạt động, đã tạo ra những diễn biến giao dịch mới sau 7 tháng đóng băng vì lệnh cấm từ phía các cơ quan quản lý.</p>\r\n\r\n<p>Theo thông tin từ một số đơn vị phân phối, trong vòng 2 tháng trở lại đây, liên tục các đoàn khách hàng là nhà đầu tư địa ốc bắt đầu đến Vân Đồn để tìm hiểu cơ hội đầu tư, giao dịch mua bán đất nền tại dự án hoặc “săn” đất thổ cư.</p>\r\n\r\n<p>Không khí diễn ra khá sôi động, thậm chí đến tận sát Tết Âm lịch vẫn có nhiều đoàn khách liên hệ tìm hiểu thông tin hoặc trực tiếp qua sàn để tìm hiểu về các dự án hiện nay đang có mặt tại Vân Đồn và các dự án có đủ điều để giao dịch.</p>\r\n\r\n<p>Bà Nguyễn Như Ý, Tổng giám đốc Real Home cho biết, các khu vực được khách hàng quan tâm nhiều nhất là đất dọc trục đường 334 từ Đông Xá đến Hạ Long, một số dự án như Khu đô thị Thống Nhất, Khu đô thị Phương Đông, Khu đô thị Ao Tiên, Dự án Vương Long, Khu tái định cư xã Đoàn Kết, Hạ Long với mức giá trung bình từ 20 – 40 triệu đồng/m2.</p>\r\n\r\n<p>Trong đó, giá đất dọc trục đường 334 đang giao dịch ở mức 22 – 26 triệu đồng/m2, một số lô đất thổ cư tại khu vực trung tâm có thể lên đến 50 – 60 triệu đồng/m2. Khu Thống Nhất giá đất giao dịch ở mức từ 25 – 45 triệu đồng/m2.</p>\r\n\r\n<p>Với đất nền khu tái định cư Đoàn Kết, những lô đất mặt trong tăng giá từ mức 11 – 13 triệu đồng/m2 lên 12,5 – 15 triệu đồng/m2. Những lô 2 mặt tiền, đường ô tô có thể đi vào, gần trung tâm, giá tăng từ 15 – 17 triệu đồng/m2 lên mức 18 – 20 triệu đồng/m2.</p>\r\n\r\n<figure aria-describedby=\"caption-attachment-29606\" id=\"attachment_29606\"><img alt=\"\" height=\"721\" sizes=\"(max-width: 900px) 100vw, 900px\" src=\"https://news.mogi.vn/wp-content/uploads/2019/03/con-so-dat-V%C4%90.png\" srcset=\"https://news.mogi.vn/wp-content/uploads/2019/03/con-so-dat-VĐ.png 900w, https://news.mogi.vn/wp-content/uploads/2019/03/con-so-dat-VĐ-300x240.png 300w, https://news.mogi.vn/wp-content/uploads/2019/03/con-so-dat-VĐ-768x615.png 768w, https://news.mogi.vn/wp-content/uploads/2019/03/con-so-dat-VĐ-696x558.png 696w, https://news.mogi.vn/wp-content/uploads/2019/03/con-so-dat-VĐ-524x420.png 524w\" width=\"900\" />\r\n<figcaption id=\"caption-attachment-29606\">Các dự án ở Vân Đồn vẫn đang là địa điểm hút mạnh dòng tiền.</figcaption>\r\n</figure>\r\n\r\n<p>Đất mặt đường 334 Đông Xá, được chào bán khoảng 23 – 28 triệu đồng/m2 trong khi thời điểm trước đó khoảng 1 tháng là 20 – 25 triệu đồng/m2. Những lô đất bên trong có giá bán từ 22 – 26 triệu đồng/m2, tăng 2 – 3 triệu đồng/m2 so với vài tháng trước.</p>\r\n\r\n<p>Mặc dù thấp hơn so với thời điểm sốt nóng hồi đầu năm 2018, tuy nhiên, trong vòng 2 tháng trở lại đây, thông qua các giao dịch thứ cấp, giá đất cũng bắt đầu tăng.</p>\r\n\r\n<h2><strong>Có hay không chuyện cò đất kiếm 1 tỷ/ngày?</strong></h2>\r\n\r\n<p>Bà Nguyễn Như Ý – Chủ nhiệm văn phòng đại diện Hội Môi giới bất động sản Việt Nam tại Vân Đồn xác nhận thông tin trên là có thể xảy ra.</p>\r\n\r\n<p>Theo bà Ý,&nbsp;thông tin đó nếu có hoàn toàn mang tính chất cá nhân&nbsp;bởi đối với câu chuyện môi giới đạt mức doanh thu 1 tỷ đồng/ngày nó diễn ra trong khoảng thời gian rất ngắn, người môi giới đó không phải chỉ là&nbsp;người làm công việc môi giới thông thường mà là một nhà môi giới đầu tư, tức là họ vừa bỏ một khoản tiền ra tự đầu tư, sau đó bán đi sản phẩm của chính mình.</p>\r\n\r\n<p>Như vậy, câu chuyện này bao gồm 2 công đoạn đó là lợi nhuận của nhà đầu tư và lợi nhuận của nhà môi giới. Khi có giá trị cộng gộp&nbsp;việc trên hoàn toàn có thể đạt được.</p>\r\n\r\n<p>Tại Vân Đồn, hiện nay mức&nbsp;<a href=\"https://mogi.vn/gia-nha-dat\">giá đất ở</a>&nbsp;thị trường đang giao dịch ở mức trung bình. Mức giá từ 20 – 30 triệu/m2 thời điểm này được cho rằng là hoàn toàn hợp lý và khả năng tăng giá còn rất lớn trong tương lai khi Vân Đồn trở thành đặc khu kinh tế hay vùng kinh tế có ưu đãi về chính sách của Nhà nước.</p>\r\n\r\n<figure aria-describedby=\"caption-attachment-29604\" id=\"attachment_29604\"><img alt=\"\" height=\"506\" sizes=\"(max-width: 900px) 100vw, 900px\" src=\"https://news.mogi.vn/wp-content/uploads/2019/03/con-so-dat-V%C4%90-2.png\" srcset=\"https://news.mogi.vn/wp-content/uploads/2019/03/con-so-dat-VĐ-2.png 900w, https://news.mogi.vn/wp-content/uploads/2019/03/con-so-dat-VĐ-2-300x169.png 300w, https://news.mogi.vn/wp-content/uploads/2019/03/con-so-dat-VĐ-2-768x432.png 768w, https://news.mogi.vn/wp-content/uploads/2019/03/con-so-dat-VĐ-2-696x391.png 696w, https://news.mogi.vn/wp-content/uploads/2019/03/con-so-dat-VĐ-2-747x420.png 747w\" width=\"900\" />\r\n<figcaption id=\"caption-attachment-29604\">Trên thực tế, việc các “cò đất” kiếm 1 tỷ/ngày là có thể xảy ra.</figcaption>\r\n</figure>\r\n\r\n<p>Nếu trong tương lai, cơ chế đặc khu được thông qua hoặc nếu có một cơ chế đặc thù dành cho Vân Đồn nói riêng và Quảng Ninh nói chung thì Vân Đồn sẽ có sức bật rất lớn.</p>\r\n\r\n<p>Trong bối cảnh hiện tại, khi sân bay đã được đầu tư, đường cao tốc nối Vân Đồn với Hà Nội và các vùng lân cận cũng đã hoàn thiện, sắp tới khi các hoạt động logictis, xuất nhập khẩu cũng như khai thác các khu phí thuế quan, các khu công nghệ cao được đẩy mạnh… thì&nbsp; những tổ hợp, những dự án đã được đầu tư đến Vân Đồn cũng như những ưu đãi vốn có về điều kiện tự nhiên của Vân Đồn thì chắc chắn trong thời gian tới Vân Đồn sẽ cất cánh và thị trường bất động sản sẽ tăng giá mạnh.</p>\r\n\r\n<p>Có lẽ việc thổi giá đất cũng như dùng các chiêu thức để bán hàng của một số môi giới không chỉ diễn ra ở Vân Đồn mà cũng đã xảy ra ở rất nhiều tỉnh thành khác trên cả nước. Tuy nhiên, với vai trò của các cơ quan chức năng, sẽ có trách nhiệm và định hướng về quy chuẩn thông tin khách quan về thị trường đó là mang lại thông tin xác thực, trung thực, đồng thời giúp nhà nghiên cứu đưa ra các giải pháp, chính sách để kịp thời phổ biến cho người dân cũng như các nhà đầu tư. Chính vì vậy mà các nhà đầu tư nên tìm hiểu kỹ càng và thận trọng khi đầu tư.</p>\r\n\r\n<p><strong>Thanh Hoa (tổng hợp)</strong></p>', 22, NULL, 22, NULL, 0, 1, NULL, NULL, NULL, 0, NULL, NULL, NULL, 1, '2019-01-15 15:40:26', '2020-05-14 11:51:57', '2020-05-14 11:51:57', 1);
INSERT INTO `lck_post` VALUES (7, '“Hé lộ” 4 chiêu thổi giá nhà đất cao tạo sóng ảo, nhiễu thị trường', 'he-lo-4-chieu-thoi-gia-nha-dat-cao-tao-song-ao-nhieu-thi-truong', 'Thị trường bất động sản nhiều năm gần đây có sự biến thiên liên tục, nhất là tình trạng sốt đất tăng cao. Những đợt giá ảo mức cao ngất ngưỡng liên tục nổ ra không chỉ đơn thuần là hành vi mặc cả, mà đó còn là chiêu tạo sóng ảo của bên bán, nhằm lập mốc tham chiếu mới để đẩy rổ hàng còn lại với cột giá cao.', '<p>Theo sự phân tích của ông Trần Khánh Quang, Tổng giám đốc Công ty bất động sản Việt An Hòa, khi có những mốc giá chào bán cao đến mức không tưởng bất ngờ xuất hiện trên thị trường địa ốc, đó không chỉ đơn giản là hành vi mặc cả mà còn chứa nhiều ẩn ý phía sau. Có ít nhất 4 lý do dẫn đến hành vi thổi giá bất thường này mà người mua đất cần quan tâm nghiên cứu, tránh tiền mất tật mang.</p>\r\n\r\n<h2><em><strong>1. Đẩy giá đất lên cao vì chưa muốn bán</strong></em></h2>\r\n\r\n<p>Có nhiều chủ nhà, vì chưa muốn bán ngôi nhà của mình nên cố tình hét giá cao gấp 2-3 lần so với những ngôi nhà nằm cùng khu vực, cùng vị trí, xem như một lời thách thức với những người có nhu cầu mua. Tuy nhiên, mức giá chào bán này lại vô tình tạo nên hiệu ứng lây lan thông tin ảo, làm nhiễu loạn thị trường nhà đất.</p>\r\n\r\n<figure aria-describedby=\"caption-attachment-29481\" id=\"attachment_29481\"><img alt=\"“Hé lộ” 4 chiêu thổi giá nhà đất cao tạo sóng ảo, nhiễu thị trường ảnh 2\" height=\"500\" sizes=\"(max-width: 800px) 100vw, 800px\" src=\"https://news.mogi.vn/wp-content/uploads/2019/03/he-lo-4-chieu-thoi-gia-nha-dat-cao-tao-song-ao-nhieu-thi-truong-anh-2.jpg\" srcset=\"https://news.mogi.vn/wp-content/uploads/2019/03/he-lo-4-chieu-thoi-gia-nha-dat-cao-tao-song-ao-nhieu-thi-truong-anh-2.jpg 800w, https://news.mogi.vn/wp-content/uploads/2019/03/he-lo-4-chieu-thoi-gia-nha-dat-cao-tao-song-ao-nhieu-thi-truong-anh-2-300x188.jpg 300w, https://news.mogi.vn/wp-content/uploads/2019/03/he-lo-4-chieu-thoi-gia-nha-dat-cao-tao-song-ao-nhieu-thi-truong-anh-2-768x480.jpg 768w, https://news.mogi.vn/wp-content/uploads/2019/03/he-lo-4-chieu-thoi-gia-nha-dat-cao-tao-song-ao-nhieu-thi-truong-anh-2-696x435.jpg 696w, https://news.mogi.vn/wp-content/uploads/2019/03/he-lo-4-chieu-thoi-gia-nha-dat-cao-tao-song-ao-nhieu-thi-truong-anh-2-672x420.jpg 672w\" title=\"“Hé lộ” 4 chiêu thổi giá nhà đất cao tạo sóng ảo, nhiễu thị trường ảnh 2\" width=\"800\" />\r\n<figcaption id=\"caption-attachment-29481\">Giá bán nhà phố tăng cao một phần là do chủ chưa muốn bán</figcaption>\r\n</figure>\r\n\r\n<h2><em><strong>2. Đẩy giá lên cao nhằm tạo sóng xả hàng</strong></em></h2>\r\n\r\n<p>Một khi người bán đã có ý định thổi giá bán nhà phố lên cao ngất ngưỡng đồng nghĩa với việc một trận sốt ảo sẽ diễn ra. Đây là một trong những thủ thuật được giới buôn địa ốc sử dụng để tạo sóng cho thị trường. Trước hết, người buôn sẽ chọn một căn nhà phố nằm ở vị trí đẹp (thường là căn góc có 2 mặt tiền) rồi đưa ra cột giá chào bán cao đột biến trên một tuyến đường, con hẻm, hay một khu dân cư.</p>\r\n\r\n<p>Động thái đưa ra giá chào bán rất cao cho món hàng mẫu này thực chất là ngụ ý cố tình thiết lập mặt bằng giá tham chiếu mới cao hơn trước đây của giới đầu cơ. Tiếp đến, những người này sẽ tung ra các sản phẩm còn lại với số lượng hạn chế để chào bán với mặt bằng giá mới. Đây là một thủ thuật xả hàng khá tinh vi, và thường chỉ có người mua lầm chứ người bán không bao giờ lầm, bởi, dù xả hàng với giá nào thì người bán vẫn nắm chắc phần lãi.</p>\r\n\r\n<h2><em><strong>3. Đẩy giá cao vì nắm được nhu cầu bức thiết của người mua</strong></em></h2>\r\n\r\n<p>Có không ít trường hợp đẩy giá cao bất chấp quy luật thị trường, đó thường là những ngôi nhà, hay mảnh đất nằm ở vị trí chiến lược đặc biệt hoặc là “độc nhất vô nhị”.</p>\r\n\r\n<p>Một khu đất nằm ở vị trí mở tuyến đường lớn dẫn vào dự án cũng sẽ được người bán chào đắt gấp 4-5 lần so với mặt bằng chung của toàn khu vực. Với trường hợp này, giá bất động sản được hét cao kỷ lục là do bên bán nắm rõ “thóp” buộc phải mua bằng mọi giá của khách.</p>\r\n\r\n<figure aria-describedby=\"caption-attachment-29482\" id=\"attachment_29482\"><img alt=\"“Hé lộ” 4 chiêu thổi giá nhà đất cao tạo sóng ảo, nhiễu thị trường ảnh 3\" height=\"500\" sizes=\"(max-width: 800px) 100vw, 800px\" src=\"https://news.mogi.vn/wp-content/uploads/2019/03/he-lo-4-chieu-thoi-gia-nha-dat-cao-tao-song-ao-nhieu-thi-truong-anh-3.jpg\" srcset=\"https://news.mogi.vn/wp-content/uploads/2019/03/he-lo-4-chieu-thoi-gia-nha-dat-cao-tao-song-ao-nhieu-thi-truong-anh-3.jpg 800w, https://news.mogi.vn/wp-content/uploads/2019/03/he-lo-4-chieu-thoi-gia-nha-dat-cao-tao-song-ao-nhieu-thi-truong-anh-3-300x188.jpg 300w, https://news.mogi.vn/wp-content/uploads/2019/03/he-lo-4-chieu-thoi-gia-nha-dat-cao-tao-song-ao-nhieu-thi-truong-anh-3-768x480.jpg 768w, https://news.mogi.vn/wp-content/uploads/2019/03/he-lo-4-chieu-thoi-gia-nha-dat-cao-tao-song-ao-nhieu-thi-truong-anh-3-696x435.jpg 696w, https://news.mogi.vn/wp-content/uploads/2019/03/he-lo-4-chieu-thoi-gia-nha-dat-cao-tao-song-ao-nhieu-thi-truong-anh-3-672x420.jpg 672w\" title=\"“Hé lộ” 4 chiêu thổi giá nhà đất cao tạo sóng ảo, nhiễu thị trường ảnh 3\" width=\"800\" />\r\n<figcaption id=\"caption-attachment-29482\">Những căn nhà có địa thế thuận lợi sẽ luôn được rao bán với mức giá cao ngất ngưỡng</figcaption>\r\n</figure>\r\n\r\n<h2><em><strong>4. Đẩy giá cao để đánh lạc hướng đơn vị định giá</strong></em></h2>\r\n\r\n<p>Không phải chỉ khách&nbsp;<a href=\"https://mogi.vn/mua-nha-dat\">mua nhà đất</a>, mà ngay cả nhà băng hoặc các đơn vị tư vấn, thẩm định giá cũng là đối tượng bị nhắm đến trong cơn sóng thổi giá nhà. Bởi, tham chiếu giá thị trường là một trong những quy tắc thẩm định giá phổ biến hiện nay.</p>\r\n\r\n<p>Giới đầu cơ nắm được kẻ hở này đã sử dụng chiêu chào bán giá ảo cao hơn vài lần so với giá trị thật trong thời gian dài, khiến mặt bằng giá khu vực bị nhiễu loại. Mục đích chính là khiến các đơn vị định giá bị lạc hướng, thúc đẩy các tổ chức tín dụng cho vay dòng vốn cao hơn so với mức bình thường. Đây cũng là điểm lý giải vì sao sốt đất và nợ xấu bất động sản tại nhiều ngân hàng thường có mối liên hệ mật thiết với nhau.</p>\r\n\r\n<p><strong>DK (Tổng hợp)</strong></p>', 24, NULL, 24, NULL, 3, 1, NULL, NULL, NULL, 0, NULL, NULL, NULL, 1, '2019-04-02 09:23:15', '2020-05-14 11:51:54', '2020-05-14 11:51:54', 1);
INSERT INTO `lck_post` VALUES (8, 'Cơn sốt đất ở Vân Đồn: Có hay không chuyện cò đất kiếm 1 tỷ/ ngày?', 'con-sot-dat-o-van-don-co-hay-khong-chuyen-co-dat-kiem-1-ty-ngay', 'Trong những ngày đầu tháng 3 đến nay, thị trường BĐS chiêm ngưỡng một cơn sốt đất chưa hề có tại Vân Đồn – Quảng Ninh. Liên tục nhưng khu đật được phân lô, sang nền và được các “cò đất” nâng giá lên tới mức kỷ lục. “Cò đất” còn kháo nhau, có những “cò” chuyên nghiệp, kiếm tới 1 tỷ đồng/ ngày.', '<h2><strong>Giá đất tăng từng ngày</strong></h2>\r\n\r\n<p>Thông tin về tình hình giao dịch đất đai sôi động tại&nbsp;Vân Đồn, tỉnh Quảng Ninh bắt đầu từ đầu năm 2019, ngay sau quyết định của tỉnh cho phép mở cửa giao dịch lại một số dự án tại địa phương này.</p>\r\n\r\n<p>Theo đó, từ ngày 9-1-2019, UBND huyện Vân Đồn đã chính thức tiếp nhận hồ sơ về việc giải quyết thủ tục hành chính về đất đai trên địa bàn, cho phép giao dịch mua bán quyền sử dụng đất đai đối với những trường hợp đủ điều kiện theo quy định pháp luật.</p>\r\n\r\n<figure aria-describedby=\"caption-attachment-29603\" id=\"attachment_29603\"><img alt=\"\" height=\"506\" sizes=\"(max-width: 900px) 100vw, 900px\" src=\"https://news.mogi.vn/wp-content/uploads/2019/03/con-so-dat-V%C4%90-1.png\" srcset=\"https://news.mogi.vn/wp-content/uploads/2019/03/con-so-dat-VĐ-1.png 900w, https://news.mogi.vn/wp-content/uploads/2019/03/con-so-dat-VĐ-1-300x169.png 300w, https://news.mogi.vn/wp-content/uploads/2019/03/con-so-dat-VĐ-1-768x432.png 768w, https://news.mogi.vn/wp-content/uploads/2019/03/con-so-dat-VĐ-1-696x391.png 696w, https://news.mogi.vn/wp-content/uploads/2019/03/con-so-dat-VĐ-1-747x420.png 747w\" width=\"900\" />\r\n<figcaption id=\"caption-attachment-29603\">Tỉnh Quảng Ninh “mở cửa” cho các giao dịch mua bán quyền sử dụng đất tại Vân Đồn.</figcaption>\r\n</figure>\r\n\r\n<p>Cùng với việc nhiều dự án hạ tầng giao thông lớn tại Quảng Ninh, đặc biệt là sân bay Vân Đồn đi vào hoạt động, đã tạo ra những diễn biến giao dịch mới sau 7 tháng đóng băng vì lệnh cấm từ phía các cơ quan quản lý.</p>\r\n\r\n<p>Theo thông tin từ một số đơn vị phân phối, trong vòng 2 tháng trở lại đây, liên tục các đoàn khách hàng là nhà đầu tư địa ốc bắt đầu đến Vân Đồn để tìm hiểu cơ hội đầu tư, giao dịch mua bán đất nền tại dự án hoặc “săn” đất thổ cư.</p>\r\n\r\n<p>Không khí diễn ra khá sôi động, thậm chí đến tận sát Tết Âm lịch vẫn có nhiều đoàn khách liên hệ tìm hiểu thông tin hoặc trực tiếp qua sàn để tìm hiểu về các dự án hiện nay đang có mặt tại Vân Đồn và các dự án có đủ điều để giao dịch.</p>\r\n\r\n<p>Bà Nguyễn Như Ý, Tổng giám đốc Real Home cho biết, các khu vực được khách hàng quan tâm nhiều nhất là đất dọc trục đường 334 từ Đông Xá đến Hạ Long, một số dự án như Khu đô thị Thống Nhất, Khu đô thị Phương Đông, Khu đô thị Ao Tiên, Dự án Vương Long, Khu tái định cư xã Đoàn Kết, Hạ Long với mức giá trung bình từ 20 – 40 triệu đồng/m2.</p>\r\n\r\n<p>Trong đó, giá đất dọc trục đường 334 đang giao dịch ở mức 22 – 26 triệu đồng/m2, một số lô đất thổ cư tại khu vực trung tâm có thể lên đến 50 – 60 triệu đồng/m2. Khu Thống Nhất giá đất giao dịch ở mức từ 25 – 45 triệu đồng/m2.</p>\r\n\r\n<p>Với đất nền khu tái định cư Đoàn Kết, những lô đất mặt trong tăng giá từ mức 11 – 13 triệu đồng/m2 lên 12,5 – 15 triệu đồng/m2. Những lô 2 mặt tiền, đường ô tô có thể đi vào, gần trung tâm, giá tăng từ 15 – 17 triệu đồng/m2 lên mức 18 – 20 triệu đồng/m2.</p>\r\n\r\n<figure aria-describedby=\"caption-attachment-29606\" id=\"attachment_29606\"><img alt=\"\" height=\"721\" sizes=\"(max-width: 900px) 100vw, 900px\" src=\"https://news.mogi.vn/wp-content/uploads/2019/03/con-so-dat-V%C4%90.png\" srcset=\"https://news.mogi.vn/wp-content/uploads/2019/03/con-so-dat-VĐ.png 900w, https://news.mogi.vn/wp-content/uploads/2019/03/con-so-dat-VĐ-300x240.png 300w, https://news.mogi.vn/wp-content/uploads/2019/03/con-so-dat-VĐ-768x615.png 768w, https://news.mogi.vn/wp-content/uploads/2019/03/con-so-dat-VĐ-696x558.png 696w, https://news.mogi.vn/wp-content/uploads/2019/03/con-so-dat-VĐ-524x420.png 524w\" width=\"900\" />\r\n<figcaption id=\"caption-attachment-29606\">Các dự án ở Vân Đồn vẫn đang là địa điểm hút mạnh dòng tiền.</figcaption>\r\n</figure>\r\n\r\n<p>Đất mặt đường 334 Đông Xá, được chào bán khoảng 23 – 28 triệu đồng/m2 trong khi thời điểm trước đó khoảng 1 tháng là 20 – 25 triệu đồng/m2. Những lô đất bên trong có giá bán từ 22 – 26 triệu đồng/m2, tăng 2 – 3 triệu đồng/m2 so với vài tháng trước.</p>\r\n\r\n<p>Mặc dù thấp hơn so với thời điểm sốt nóng hồi đầu năm 2018, tuy nhiên, trong vòng 2 tháng trở lại đây, thông qua các giao dịch thứ cấp, giá đất cũng bắt đầu tăng.</p>\r\n\r\n<h2><strong>Có hay không chuyện cò đất kiếm 1 tỷ/ngày?</strong></h2>\r\n\r\n<p>Bà Nguyễn Như Ý – Chủ nhiệm văn phòng đại diện Hội Môi giới bất động sản Việt Nam tại Vân Đồn xác nhận thông tin trên là có thể xảy ra.</p>\r\n\r\n<p>Theo bà Ý,&nbsp;thông tin đó nếu có hoàn toàn mang tính chất cá nhân&nbsp;bởi đối với câu chuyện môi giới đạt mức doanh thu 1 tỷ đồng/ngày nó diễn ra trong khoảng thời gian rất ngắn, người môi giới đó không phải chỉ là&nbsp;người làm công việc môi giới thông thường mà là một nhà môi giới đầu tư, tức là họ vừa bỏ một khoản tiền ra tự đầu tư, sau đó bán đi sản phẩm của chính mình.</p>\r\n\r\n<p>Như vậy, câu chuyện này bao gồm 2 công đoạn đó là lợi nhuận của nhà đầu tư và lợi nhuận của nhà môi giới. Khi có giá trị cộng gộp&nbsp;việc trên hoàn toàn có thể đạt được.</p>\r\n\r\n<p>Tại Vân Đồn, hiện nay mức&nbsp;<a href=\"https://mogi.vn/gia-nha-dat\">giá đất ở</a>&nbsp;thị trường đang giao dịch ở mức trung bình. Mức giá từ 20 – 30 triệu/m2 thời điểm này được cho rằng là hoàn toàn hợp lý và khả năng tăng giá còn rất lớn trong tương lai khi Vân Đồn trở thành đặc khu kinh tế hay vùng kinh tế có ưu đãi về chính sách của Nhà nước.</p>\r\n\r\n<figure aria-describedby=\"caption-attachment-29604\" id=\"attachment_29604\"><img alt=\"\" height=\"506\" sizes=\"(max-width: 900px) 100vw, 900px\" src=\"https://news.mogi.vn/wp-content/uploads/2019/03/con-so-dat-V%C4%90-2.png\" srcset=\"https://news.mogi.vn/wp-content/uploads/2019/03/con-so-dat-VĐ-2.png 900w, https://news.mogi.vn/wp-content/uploads/2019/03/con-so-dat-VĐ-2-300x169.png 300w, https://news.mogi.vn/wp-content/uploads/2019/03/con-so-dat-VĐ-2-768x432.png 768w, https://news.mogi.vn/wp-content/uploads/2019/03/con-so-dat-VĐ-2-696x391.png 696w, https://news.mogi.vn/wp-content/uploads/2019/03/con-so-dat-VĐ-2-747x420.png 747w\" width=\"900\" />\r\n<figcaption id=\"caption-attachment-29604\">Trên thực tế, việc các “cò đất” kiếm 1 tỷ/ngày là có thể xảy ra.</figcaption>\r\n</figure>\r\n\r\n<p>Nếu trong tương lai, cơ chế đặc khu được thông qua hoặc nếu có một cơ chế đặc thù dành cho Vân Đồn nói riêng và Quảng Ninh nói chung thì Vân Đồn sẽ có sức bật rất lớn.</p>\r\n\r\n<p>Trong bối cảnh hiện tại, khi sân bay đã được đầu tư, đường cao tốc nối Vân Đồn với Hà Nội và các vùng lân cận cũng đã hoàn thiện, sắp tới khi các hoạt động logictis, xuất nhập khẩu cũng như khai thác các khu phí thuế quan, các khu công nghệ cao được đẩy mạnh… thì&nbsp; những tổ hợp, những dự án đã được đầu tư đến Vân Đồn cũng như những ưu đãi vốn có về điều kiện tự nhiên của Vân Đồn thì chắc chắn trong thời gian tới Vân Đồn sẽ cất cánh và thị trường bất động sản sẽ tăng giá mạnh.</p>\r\n\r\n<p>Có lẽ việc thổi giá đất cũng như dùng các chiêu thức để bán hàng của một số môi giới không chỉ diễn ra ở Vân Đồn mà cũng đã xảy ra ở rất nhiều tỉnh thành khác trên cả nước. Tuy nhiên, với vai trò của các cơ quan chức năng, sẽ có trách nhiệm và định hướng về quy chuẩn thông tin khách quan về thị trường đó là mang lại thông tin xác thực, trung thực, đồng thời giúp nhà nghiên cứu đưa ra các giải pháp, chính sách để kịp thời phổ biến cho người dân cũng như các nhà đầu tư. Chính vì vậy mà các nhà đầu tư nên tìm hiểu kỹ càng và thận trọng khi đầu tư.</p>\r\n\r\n<p><strong>Thanh Hoa (tổng hợp)</strong></p>', 20, NULL, 20, NULL, 0, 1, NULL, NULL, NULL, 0, NULL, NULL, NULL, 1, '2019-01-15 15:40:26', '2020-05-14 11:51:51', '2020-05-14 11:51:51', 1);
INSERT INTO `lck_post` VALUES (9, '“Hé lộ” 4 chiêu thổi giá nhà đất cao tạo sóng ảo, nhiễu thị trường', 'he-lo-4-chieu-thoi-gia-nha-dat-cao-tao-song-ao-nhieu-thi-truong', 'Thị trường bất động sản nhiều năm gần đây có sự biến thiên liên tục, nhất là tình trạng sốt đất tăng cao. Những đợt giá ảo mức cao ngất ngưỡng liên tục nổ ra không chỉ đơn thuần là hành vi mặc cả, mà đó còn là chiêu tạo sóng ảo của bên bán, nhằm lập mốc tham chiếu mới để đẩy rổ hàng còn lại với cột giá cao.', '<p>Theo sự phân tích của ông Trần Khánh Quang, Tổng giám đốc Công ty bất động sản Việt An Hòa, khi có những mốc giá chào bán cao đến mức không tưởng bất ngờ xuất hiện trên thị trường địa ốc, đó không chỉ đơn giản là hành vi mặc cả mà còn chứa nhiều ẩn ý phía sau. Có ít nhất 4 lý do dẫn đến hành vi thổi giá bất thường này mà người mua đất cần quan tâm nghiên cứu, tránh tiền mất tật mang.</p>\r\n\r\n<h2><em><strong>1. Đẩy giá đất lên cao vì chưa muốn bán</strong></em></h2>\r\n\r\n<p>Có nhiều chủ nhà, vì chưa muốn bán ngôi nhà của mình nên cố tình hét giá cao gấp 2-3 lần so với những ngôi nhà nằm cùng khu vực, cùng vị trí, xem như một lời thách thức với những người có nhu cầu mua. Tuy nhiên, mức giá chào bán này lại vô tình tạo nên hiệu ứng lây lan thông tin ảo, làm nhiễu loạn thị trường nhà đất.</p>\r\n\r\n<figure aria-describedby=\"caption-attachment-29481\" id=\"attachment_29481\"><img alt=\"“Hé lộ” 4 chiêu thổi giá nhà đất cao tạo sóng ảo, nhiễu thị trường ảnh 2\" height=\"500\" sizes=\"(max-width: 800px) 100vw, 800px\" src=\"https://news.mogi.vn/wp-content/uploads/2019/03/he-lo-4-chieu-thoi-gia-nha-dat-cao-tao-song-ao-nhieu-thi-truong-anh-2.jpg\" srcset=\"https://news.mogi.vn/wp-content/uploads/2019/03/he-lo-4-chieu-thoi-gia-nha-dat-cao-tao-song-ao-nhieu-thi-truong-anh-2.jpg 800w, https://news.mogi.vn/wp-content/uploads/2019/03/he-lo-4-chieu-thoi-gia-nha-dat-cao-tao-song-ao-nhieu-thi-truong-anh-2-300x188.jpg 300w, https://news.mogi.vn/wp-content/uploads/2019/03/he-lo-4-chieu-thoi-gia-nha-dat-cao-tao-song-ao-nhieu-thi-truong-anh-2-768x480.jpg 768w, https://news.mogi.vn/wp-content/uploads/2019/03/he-lo-4-chieu-thoi-gia-nha-dat-cao-tao-song-ao-nhieu-thi-truong-anh-2-696x435.jpg 696w, https://news.mogi.vn/wp-content/uploads/2019/03/he-lo-4-chieu-thoi-gia-nha-dat-cao-tao-song-ao-nhieu-thi-truong-anh-2-672x420.jpg 672w\" title=\"“Hé lộ” 4 chiêu thổi giá nhà đất cao tạo sóng ảo, nhiễu thị trường ảnh 2\" width=\"800\" />\r\n<figcaption id=\"caption-attachment-29481\">Giá bán nhà phố tăng cao một phần là do chủ chưa muốn bán</figcaption>\r\n</figure>\r\n\r\n<h2><em><strong>2. Đẩy giá lên cao nhằm tạo sóng xả hàng</strong></em></h2>\r\n\r\n<p>Một khi người bán đã có ý định thổi giá bán nhà phố lên cao ngất ngưỡng đồng nghĩa với việc một trận sốt ảo sẽ diễn ra. Đây là một trong những thủ thuật được giới buôn địa ốc sử dụng để tạo sóng cho thị trường. Trước hết, người buôn sẽ chọn một căn nhà phố nằm ở vị trí đẹp (thường là căn góc có 2 mặt tiền) rồi đưa ra cột giá chào bán cao đột biến trên một tuyến đường, con hẻm, hay một khu dân cư.</p>\r\n\r\n<p>Động thái đưa ra giá chào bán rất cao cho món hàng mẫu này thực chất là ngụ ý cố tình thiết lập mặt bằng giá tham chiếu mới cao hơn trước đây của giới đầu cơ. Tiếp đến, những người này sẽ tung ra các sản phẩm còn lại với số lượng hạn chế để chào bán với mặt bằng giá mới. Đây là một thủ thuật xả hàng khá tinh vi, và thường chỉ có người mua lầm chứ người bán không bao giờ lầm, bởi, dù xả hàng với giá nào thì người bán vẫn nắm chắc phần lãi.</p>\r\n\r\n<h2><em><strong>3. Đẩy giá cao vì nắm được nhu cầu bức thiết của người mua</strong></em></h2>\r\n\r\n<p>Có không ít trường hợp đẩy giá cao bất chấp quy luật thị trường, đó thường là những ngôi nhà, hay mảnh đất nằm ở vị trí chiến lược đặc biệt hoặc là “độc nhất vô nhị”.</p>\r\n\r\n<p>Một khu đất nằm ở vị trí mở tuyến đường lớn dẫn vào dự án cũng sẽ được người bán chào đắt gấp 4-5 lần so với mặt bằng chung của toàn khu vực. Với trường hợp này, giá bất động sản được hét cao kỷ lục là do bên bán nắm rõ “thóp” buộc phải mua bằng mọi giá của khách.</p>\r\n\r\n<figure aria-describedby=\"caption-attachment-29482\" id=\"attachment_29482\"><img alt=\"“Hé lộ” 4 chiêu thổi giá nhà đất cao tạo sóng ảo, nhiễu thị trường ảnh 3\" height=\"500\" sizes=\"(max-width: 800px) 100vw, 800px\" src=\"https://news.mogi.vn/wp-content/uploads/2019/03/he-lo-4-chieu-thoi-gia-nha-dat-cao-tao-song-ao-nhieu-thi-truong-anh-3.jpg\" srcset=\"https://news.mogi.vn/wp-content/uploads/2019/03/he-lo-4-chieu-thoi-gia-nha-dat-cao-tao-song-ao-nhieu-thi-truong-anh-3.jpg 800w, https://news.mogi.vn/wp-content/uploads/2019/03/he-lo-4-chieu-thoi-gia-nha-dat-cao-tao-song-ao-nhieu-thi-truong-anh-3-300x188.jpg 300w, https://news.mogi.vn/wp-content/uploads/2019/03/he-lo-4-chieu-thoi-gia-nha-dat-cao-tao-song-ao-nhieu-thi-truong-anh-3-768x480.jpg 768w, https://news.mogi.vn/wp-content/uploads/2019/03/he-lo-4-chieu-thoi-gia-nha-dat-cao-tao-song-ao-nhieu-thi-truong-anh-3-696x435.jpg 696w, https://news.mogi.vn/wp-content/uploads/2019/03/he-lo-4-chieu-thoi-gia-nha-dat-cao-tao-song-ao-nhieu-thi-truong-anh-3-672x420.jpg 672w\" title=\"“Hé lộ” 4 chiêu thổi giá nhà đất cao tạo sóng ảo, nhiễu thị trường ảnh 3\" width=\"800\" />\r\n<figcaption id=\"caption-attachment-29482\">Những căn nhà có địa thế thuận lợi sẽ luôn được rao bán với mức giá cao ngất ngưỡng</figcaption>\r\n</figure>\r\n\r\n<h2><em><strong>4. Đẩy giá cao để đánh lạc hướng đơn vị định giá</strong></em></h2>\r\n\r\n<p>Không phải chỉ khách&nbsp;<a href=\"https://mogi.vn/mua-nha-dat\">mua nhà đất</a>, mà ngay cả nhà băng hoặc các đơn vị tư vấn, thẩm định giá cũng là đối tượng bị nhắm đến trong cơn sóng thổi giá nhà. Bởi, tham chiếu giá thị trường là một trong những quy tắc thẩm định giá phổ biến hiện nay.</p>\r\n\r\n<p>Giới đầu cơ nắm được kẻ hở này đã sử dụng chiêu chào bán giá ảo cao hơn vài lần so với giá trị thật trong thời gian dài, khiến mặt bằng giá khu vực bị nhiễu loại. Mục đích chính là khiến các đơn vị định giá bị lạc hướng, thúc đẩy các tổ chức tín dụng cho vay dòng vốn cao hơn so với mức bình thường. Đây cũng là điểm lý giải vì sao sốt đất và nợ xấu bất động sản tại nhiều ngân hàng thường có mối liên hệ mật thiết với nhau.</p>\r\n\r\n<p><strong>DK (Tổng hợp)</strong></p>', 22, NULL, 22, NULL, 5, 1, NULL, NULL, NULL, 0, NULL, NULL, NULL, 1, '2019-04-02 09:23:15', '2020-05-14 11:51:49', '2020-05-14 11:51:49', 1);
INSERT INTO `lck_post` VALUES (10, 'Cơn sốt đất ở Vân Đồn: Có hay không chuyện cò đất kiếm 1 tỷ/ ngày?', 'con-sot-dat-o-van-don-co-hay-khong-chuyen-co-dat-kiem-1-ty-ngay', 'Trong những ngày đầu tháng 3 đến nay, thị trường BĐS chiêm ngưỡng một cơn sốt đất chưa hề có tại Vân Đồn – Quảng Ninh. Liên tục nhưng khu đật được phân lô, sang nền và được các “cò đất” nâng giá lên tới mức kỷ lục. “Cò đất” còn kháo nhau, có những “cò” chuyên nghiệp, kiếm tới 1 tỷ đồng/ ngày.', '<h2><strong>Giá đất tăng từng ngày</strong></h2>\r\n\r\n<p>Thông tin về tình hình giao dịch đất đai sôi động tại&nbsp;Vân Đồn, tỉnh Quảng Ninh bắt đầu từ đầu năm 2019, ngay sau quyết định của tỉnh cho phép mở cửa giao dịch lại một số dự án tại địa phương này.</p>\r\n\r\n<p>Theo đó, từ ngày 9-1-2019, UBND huyện Vân Đồn đã chính thức tiếp nhận hồ sơ về việc giải quyết thủ tục hành chính về đất đai trên địa bàn, cho phép giao dịch mua bán quyền sử dụng đất đai đối với những trường hợp đủ điều kiện theo quy định pháp luật.</p>\r\n\r\n<figure aria-describedby=\"caption-attachment-29603\" id=\"attachment_29603\"><img alt=\"\" height=\"506\" sizes=\"(max-width: 900px) 100vw, 900px\" src=\"https://news.mogi.vn/wp-content/uploads/2019/03/con-so-dat-V%C4%90-1.png\" srcset=\"https://news.mogi.vn/wp-content/uploads/2019/03/con-so-dat-VĐ-1.png 900w, https://news.mogi.vn/wp-content/uploads/2019/03/con-so-dat-VĐ-1-300x169.png 300w, https://news.mogi.vn/wp-content/uploads/2019/03/con-so-dat-VĐ-1-768x432.png 768w, https://news.mogi.vn/wp-content/uploads/2019/03/con-so-dat-VĐ-1-696x391.png 696w, https://news.mogi.vn/wp-content/uploads/2019/03/con-so-dat-VĐ-1-747x420.png 747w\" width=\"900\" />\r\n<figcaption id=\"caption-attachment-29603\">Tỉnh Quảng Ninh “mở cửa” cho các giao dịch mua bán quyền sử dụng đất tại Vân Đồn.</figcaption>\r\n</figure>\r\n\r\n<p>Cùng với việc nhiều dự án hạ tầng giao thông lớn tại Quảng Ninh, đặc biệt là sân bay Vân Đồn đi vào hoạt động, đã tạo ra những diễn biến giao dịch mới sau 7 tháng đóng băng vì lệnh cấm từ phía các cơ quan quản lý.</p>\r\n\r\n<p>Theo thông tin từ một số đơn vị phân phối, trong vòng 2 tháng trở lại đây, liên tục các đoàn khách hàng là nhà đầu tư địa ốc bắt đầu đến Vân Đồn để tìm hiểu cơ hội đầu tư, giao dịch mua bán đất nền tại dự án hoặc “săn” đất thổ cư.</p>\r\n\r\n<p>Không khí diễn ra khá sôi động, thậm chí đến tận sát Tết Âm lịch vẫn có nhiều đoàn khách liên hệ tìm hiểu thông tin hoặc trực tiếp qua sàn để tìm hiểu về các dự án hiện nay đang có mặt tại Vân Đồn và các dự án có đủ điều để giao dịch.</p>\r\n\r\n<p>Bà Nguyễn Như Ý, Tổng giám đốc Real Home cho biết, các khu vực được khách hàng quan tâm nhiều nhất là đất dọc trục đường 334 từ Đông Xá đến Hạ Long, một số dự án như Khu đô thị Thống Nhất, Khu đô thị Phương Đông, Khu đô thị Ao Tiên, Dự án Vương Long, Khu tái định cư xã Đoàn Kết, Hạ Long với mức giá trung bình từ 20 – 40 triệu đồng/m2.</p>\r\n\r\n<p>Trong đó, giá đất dọc trục đường 334 đang giao dịch ở mức 22 – 26 triệu đồng/m2, một số lô đất thổ cư tại khu vực trung tâm có thể lên đến 50 – 60 triệu đồng/m2. Khu Thống Nhất giá đất giao dịch ở mức từ 25 – 45 triệu đồng/m2.</p>\r\n\r\n<p>Với đất nền khu tái định cư Đoàn Kết, những lô đất mặt trong tăng giá từ mức 11 – 13 triệu đồng/m2 lên 12,5 – 15 triệu đồng/m2. Những lô 2 mặt tiền, đường ô tô có thể đi vào, gần trung tâm, giá tăng từ 15 – 17 triệu đồng/m2 lên mức 18 – 20 triệu đồng/m2.</p>\r\n\r\n<figure aria-describedby=\"caption-attachment-29606\" id=\"attachment_29606\"><img alt=\"\" height=\"721\" sizes=\"(max-width: 900px) 100vw, 900px\" src=\"https://news.mogi.vn/wp-content/uploads/2019/03/con-so-dat-V%C4%90.png\" srcset=\"https://news.mogi.vn/wp-content/uploads/2019/03/con-so-dat-VĐ.png 900w, https://news.mogi.vn/wp-content/uploads/2019/03/con-so-dat-VĐ-300x240.png 300w, https://news.mogi.vn/wp-content/uploads/2019/03/con-so-dat-VĐ-768x615.png 768w, https://news.mogi.vn/wp-content/uploads/2019/03/con-so-dat-VĐ-696x558.png 696w, https://news.mogi.vn/wp-content/uploads/2019/03/con-so-dat-VĐ-524x420.png 524w\" width=\"900\" />\r\n<figcaption id=\"caption-attachment-29606\">Các dự án ở Vân Đồn vẫn đang là địa điểm hút mạnh dòng tiền.</figcaption>\r\n</figure>\r\n\r\n<p>Đất mặt đường 334 Đông Xá, được chào bán khoảng 23 – 28 triệu đồng/m2 trong khi thời điểm trước đó khoảng 1 tháng là 20 – 25 triệu đồng/m2. Những lô đất bên trong có giá bán từ 22 – 26 triệu đồng/m2, tăng 2 – 3 triệu đồng/m2 so với vài tháng trước.</p>\r\n\r\n<p>Mặc dù thấp hơn so với thời điểm sốt nóng hồi đầu năm 2018, tuy nhiên, trong vòng 2 tháng trở lại đây, thông qua các giao dịch thứ cấp, giá đất cũng bắt đầu tăng.</p>\r\n\r\n<h2><strong>Có hay không chuyện cò đất kiếm 1 tỷ/ngày?</strong></h2>\r\n\r\n<p>Bà Nguyễn Như Ý – Chủ nhiệm văn phòng đại diện Hội Môi giới bất động sản Việt Nam tại Vân Đồn xác nhận thông tin trên là có thể xảy ra.</p>\r\n\r\n<p>Theo bà Ý,&nbsp;thông tin đó nếu có hoàn toàn mang tính chất cá nhân&nbsp;bởi đối với câu chuyện môi giới đạt mức doanh thu 1 tỷ đồng/ngày nó diễn ra trong khoảng thời gian rất ngắn, người môi giới đó không phải chỉ là&nbsp;người làm công việc môi giới thông thường mà là một nhà môi giới đầu tư, tức là họ vừa bỏ một khoản tiền ra tự đầu tư, sau đó bán đi sản phẩm của chính mình.</p>\r\n\r\n<p>Như vậy, câu chuyện này bao gồm 2 công đoạn đó là lợi nhuận của nhà đầu tư và lợi nhuận của nhà môi giới. Khi có giá trị cộng gộp&nbsp;việc trên hoàn toàn có thể đạt được.</p>\r\n\r\n<p>Tại Vân Đồn, hiện nay mức&nbsp;<a href=\"https://mogi.vn/gia-nha-dat\">giá đất ở</a>&nbsp;thị trường đang giao dịch ở mức trung bình. Mức giá từ 20 – 30 triệu/m2 thời điểm này được cho rằng là hoàn toàn hợp lý và khả năng tăng giá còn rất lớn trong tương lai khi Vân Đồn trở thành đặc khu kinh tế hay vùng kinh tế có ưu đãi về chính sách của Nhà nước.</p>\r\n\r\n<figure aria-describedby=\"caption-attachment-29604\" id=\"attachment_29604\"><img alt=\"\" height=\"506\" sizes=\"(max-width: 900px) 100vw, 900px\" src=\"https://news.mogi.vn/wp-content/uploads/2019/03/con-so-dat-V%C4%90-2.png\" srcset=\"https://news.mogi.vn/wp-content/uploads/2019/03/con-so-dat-VĐ-2.png 900w, https://news.mogi.vn/wp-content/uploads/2019/03/con-so-dat-VĐ-2-300x169.png 300w, https://news.mogi.vn/wp-content/uploads/2019/03/con-so-dat-VĐ-2-768x432.png 768w, https://news.mogi.vn/wp-content/uploads/2019/03/con-so-dat-VĐ-2-696x391.png 696w, https://news.mogi.vn/wp-content/uploads/2019/03/con-so-dat-VĐ-2-747x420.png 747w\" width=\"900\" />\r\n<figcaption id=\"caption-attachment-29604\">Trên thực tế, việc các “cò đất” kiếm 1 tỷ/ngày là có thể xảy ra.</figcaption>\r\n</figure>\r\n\r\n<p>Nếu trong tương lai, cơ chế đặc khu được thông qua hoặc nếu có một cơ chế đặc thù dành cho Vân Đồn nói riêng và Quảng Ninh nói chung thì Vân Đồn sẽ có sức bật rất lớn.</p>\r\n\r\n<p>Trong bối cảnh hiện tại, khi sân bay đã được đầu tư, đường cao tốc nối Vân Đồn với Hà Nội và các vùng lân cận cũng đã hoàn thiện, sắp tới khi các hoạt động logictis, xuất nhập khẩu cũng như khai thác các khu phí thuế quan, các khu công nghệ cao được đẩy mạnh… thì&nbsp; những tổ hợp, những dự án đã được đầu tư đến Vân Đồn cũng như những ưu đãi vốn có về điều kiện tự nhiên của Vân Đồn thì chắc chắn trong thời gian tới Vân Đồn sẽ cất cánh và thị trường bất động sản sẽ tăng giá mạnh.</p>\r\n\r\n<p>Có lẽ việc thổi giá đất cũng như dùng các chiêu thức để bán hàng của một số môi giới không chỉ diễn ra ở Vân Đồn mà cũng đã xảy ra ở rất nhiều tỉnh thành khác trên cả nước. Tuy nhiên, với vai trò của các cơ quan chức năng, sẽ có trách nhiệm và định hướng về quy chuẩn thông tin khách quan về thị trường đó là mang lại thông tin xác thực, trung thực, đồng thời giúp nhà nghiên cứu đưa ra các giải pháp, chính sách để kịp thời phổ biến cho người dân cũng như các nhà đầu tư. Chính vì vậy mà các nhà đầu tư nên tìm hiểu kỹ càng và thận trọng khi đầu tư.</p>\r\n\r\n<p><strong>Thanh Hoa (tổng hợp)</strong></p>', 24, NULL, 24, NULL, 2, 1, NULL, NULL, NULL, 0, NULL, NULL, NULL, 2, '2019-01-15 15:40:26', '2020-05-14 11:51:46', '2020-05-14 11:51:46', 1);
