INSERT INTO `lck_post_category` VALUES (2, 'Thủ thuật', 'thu-thuat', NULL, 0, 1, 2, NULL, NULL, NULL, NULL, NULL, '2019-04-02 09:08:47', '2019-04-02 09:37:22', NULL, 1);
INSERT INTO `lck_product` VALUES (1, NULL, '8', 'SLX022BKFG00', 'VALI VẢI TITAN NY 5 FG00', 'vali-vai-titan-ny-5-fg00', 'Balo Vali thương hiệu Mỹ', 'Balo Vali thương hiệu Mỹ', 'Ship nhanh', 'LH ngay', '<p><strong>TRẢI NGHIỆM DÒNG VALI CAO CẤP CÙNG NHỮNG TÍNH NĂNG ĐỘT PHÁ CỦA TITAN NY 5</strong></p>\r\n\r\n<p><em>TITAN NY 5 FG00 là dòng vali cao cấp của thương hiệu Sakos – tiêu chuẩn Hoa Kỳ. Những dòng sản phẩm của Sakos nổi bật bởi trọng lượng siêu nhẹ, thiết kế sang trọng, mang phong cách lịch lãm, độ bền thách thức thời gian. Đây là dòng vali được nhiều người chọn lựa và tin dùng, trong đó đa phần là các doanh nhân thành đạt</em>.</p>\r\n\r\n<p><strong>Thiết kế đơn giản tinh tế</strong></p>\r\n\r\n<p><a href=\"https://sakos.vn/wp-content/uploads/2020/04/BK-4.jpg\" rel=\"lightbox-0\"><img alt=\"\" data-lazy-sizes=\"(max-width: 550px) 100vw, 550px\" data-lazy-src=\"https://sakos.vn/wp-content/uploads/2020/04/BK-4.jpg\" data-lazy-srcset=\"https://sakos.vn/wp-content/uploads/2020/04/BK-4.jpg 550w, https://sakos.vn/wp-content/uploads/2020/04/BK-4-300x300.jpg 300w, https://sakos.vn/wp-content/uploads/2020/04/BK-4-100x100.jpg 100w\" data-was-processed=\"true\" height=\"550\" sizes=\"(max-width: 550px) 100vw, 550px\" src=\"https://sakos.vn/wp-content/uploads/2020/04/BK-4.jpg\" srcset=\"https://sakos.vn/wp-content/uploads/2020/04/BK-4.jpg 550w, https://sakos.vn/wp-content/uploads/2020/04/BK-4-300x300.jpg 300w, https://sakos.vn/wp-content/uploads/2020/04/BK-4-100x100.jpg 100w\" width=\"550\" /></a></p>\r\n\r\n<p>Titan FG00 được thiết kế khá đơn giản và tiện dụng, từng đường kim mũi chỉ được trau chuốt kỹ lưỡng kết hợp với các gam ga màu mạnh mẽ đem đến sự năng động nhưng không kém&nbsp; phần lịch lãm, sang trọng cho người sử dụng.</p>\r\n\r\n<p><strong>Chất liệu siêu nhẹ, trượt nước vượt trội</strong></p>\r\n\r\n<p><a href=\"https://sakos.vn/wp-content/uploads/2020/04/BK-1.jpg\" rel=\"lightbox-1\"><img alt=\"\" data-lazy-sizes=\"(max-width: 550px) 100vw, 550px\" data-lazy-src=\"https://sakos.vn/wp-content/uploads/2020/04/BK-1.jpg\" data-lazy-srcset=\"https://sakos.vn/wp-content/uploads/2020/04/BK-1.jpg 550w, https://sakos.vn/wp-content/uploads/2020/04/BK-1-300x300.jpg 300w, https://sakos.vn/wp-content/uploads/2020/04/BK-1-100x100.jpg 100w\" data-was-processed=\"true\" height=\"550\" sizes=\"(max-width: 550px) 100vw, 550px\" src=\"https://sakos.vn/wp-content/uploads/2020/04/BK-1.jpg\" srcset=\"https://sakos.vn/wp-content/uploads/2020/04/BK-1.jpg 550w, https://sakos.vn/wp-content/uploads/2020/04/BK-1-300x300.jpg 300w, https://sakos.vn/wp-content/uploads/2020/04/BK-1-100x100.jpg 100w\" width=\"550\" /></a></p>\r\n\r\n<p>Dòng vali vải cao cấp Titan được sản xuất từ 100% Polyester không pha lẫn những loại vật liệu tạp chất khác, đem đến cho bạn một sản phẩm vali nổi bật với tính năng siêu nhẹ. Bạn sẽ cảm thấy thoải mái khi xách vali trên tay hoặc di chuyển bằng bánh xe bởi trọng lượng của vali rất nhẹ.</p>\r\n\r\n<p>Ngoài ra, chất liệu Polyester là loại vải được nhiều nhà sản xuất vali, balo tin dùng bởi những đặc tính nổi bật như: trượt nước, chống bám bụi, không bị co khi giặt, chống nhăn, chống kéo giãn và bền màu.</p>\r\n\r\n<p><strong>Khóa số TSA an toàn và cần kéo chắc chắn</strong></p>\r\n\r\n<p>Titan FG00 được tích hợp dây khóa kéo đôi chống trộm chắc chắn kết hợp khóa số TSA an toàn tuyệt đối cho hành lý trong mọi chuyến đi.</p>\r\n\r\n<p><a href=\"https://sakos.vn/wp-content/uploads/2020/04/BK-5.jpg\" rel=\"lightbox-2\"><img alt=\"\" data-lazy-sizes=\"(max-width: 550px) 100vw, 550px\" data-lazy-src=\"https://sakos.vn/wp-content/uploads/2020/04/BK-5.jpg\" data-lazy-srcset=\"https://sakos.vn/wp-content/uploads/2020/04/BK-5.jpg 550w, https://sakos.vn/wp-content/uploads/2020/04/BK-5-300x300.jpg 300w, https://sakos.vn/wp-content/uploads/2020/04/BK-5-100x100.jpg 100w\" data-was-processed=\"true\" height=\"550\" sizes=\"(max-width: 550px) 100vw, 550px\" src=\"https://sakos.vn/wp-content/uploads/2020/04/BK-5.jpg\" srcset=\"https://sakos.vn/wp-content/uploads/2020/04/BK-5.jpg 550w, https://sakos.vn/wp-content/uploads/2020/04/BK-5-300x300.jpg 300w, https://sakos.vn/wp-content/uploads/2020/04/BK-5-100x100.jpg 100w\" width=\"550\" /></a></p>\r\n\r\n<p>Cần kéo vali Sakos Titan được làm từ hợp kim nhôm siêu nhẹ với các nấc có thể thay đổi bằng chốt bấm ở đầu cần kéo.</p>\r\n\r\n<p><strong>Ngăn chứa rộng rãi</strong></p>\r\n\r\n<p><a href=\"https://sakos.vn/wp-content/uploads/2020/04/BK-3.jpg\" rel=\"lightbox-3\"><img alt=\"\" data-lazy-sizes=\"(max-width: 550px) 100vw, 550px\" data-lazy-src=\"https://sakos.vn/wp-content/uploads/2020/04/BK-3.jpg\" data-lazy-srcset=\"https://sakos.vn/wp-content/uploads/2020/04/BK-3.jpg 550w, https://sakos.vn/wp-content/uploads/2020/04/BK-3-300x300.jpg 300w, https://sakos.vn/wp-content/uploads/2020/04/BK-3-100x100.jpg 100w\" data-was-processed=\"true\" height=\"550\" sizes=\"(max-width: 550px) 100vw, 550px\" src=\"https://sakos.vn/wp-content/uploads/2020/04/BK-3.jpg\" srcset=\"https://sakos.vn/wp-content/uploads/2020/04/BK-3.jpg 550w, https://sakos.vn/wp-content/uploads/2020/04/BK-3-300x300.jpg 300w, https://sakos.vn/wp-content/uploads/2020/04/BK-3-100x100.jpg 100w\" width=\"550\" /></a></p>\r\n\r\n<p>Sakos Titan NY 5 FG00 có thiết kế gồm 1 ngăn chính và ngăn phụ với khóa kéo bảo vệ đặt nằm ngang ở mặt trước vali. Ngăn chính rộng rãi có lớp vải lót mịn chống thấm hiệu quả.</p>\r\n\r\n<p><strong>Bánh xe xoay 360 độ linh hoạt</strong></p>\r\n\r\n<p><a href=\"https://sakos.vn/wp-content/uploads/2020/04/BK-2.jpg\" rel=\"lightbox-4\"><img alt=\"\" data-lazy-sizes=\"(max-width: 550px) 100vw, 550px\" data-lazy-src=\"https://sakos.vn/wp-content/uploads/2020/04/BK-2.jpg\" data-lazy-srcset=\"https://sakos.vn/wp-content/uploads/2020/04/BK-2.jpg 550w, https://sakos.vn/wp-content/uploads/2020/04/BK-2-300x300.jpg 300w, https://sakos.vn/wp-content/uploads/2020/04/BK-2-100x100.jpg 100w\" data-was-processed=\"true\" height=\"550\" sizes=\"(max-width: 550px) 100vw, 550px\" src=\"https://sakos.vn/wp-content/uploads/2020/04/BK-2.jpg\" srcset=\"https://sakos.vn/wp-content/uploads/2020/04/BK-2.jpg 550w, https://sakos.vn/wp-content/uploads/2020/04/BK-2-300x300.jpg 300w, https://sakos.vn/wp-content/uploads/2020/04/BK-2-100x100.jpg 100w\" width=\"550\" /></a></p>\r\n\r\n<p>Dòng vali kéo cao cấp Titan có thiết kế 4 bánh xe bọc cao su dẻo giúp giảm thanh khi di chuyển. Bên trong bánh xe có tích hợp túi trữ dầu tự động kích hoạt khi vận hành tạo cảm giác êm mượt dù trên địa hình gồ ghề.</p>', NULL, NULL, NULL, 2340000, 2400000, 1, 5, NULL, 5, NULL, 2, '2020-08-24 16:28:24', '2020-10-27 18:14:50', '2020-10-27 18:14:50', 0, 0, NULL, 1, 1, 1, 1, 1, NULL);
INSERT INTO `lck_product` VALUES (2, NULL, '7', 'SLX059BNFG00', 'VALI VẢI SKYLINE', 'vali-vai-skyline', 'Balo Vali thương hiệu Mỹ', 'Balo Vali thương hiệu Mỹ', 'Ship nhanh', 'LH ngay', '<p><strong>VALI VẢI SKYLINE CHỨA CẢ THẾ GIỚI ĐỒ DÙNG ĐỒNG HÀNH CÙNG NHỮNG CHUYẾN ĐI</strong></p>\r\n\r\n<p><em>Thiết kế thời trang, chất liệu cao cấp, bền bỉ với 4 màu phong phú phù hợp với mọi đối tượng người dùng, xứng đáng với danh xưng “Vali Quốc dân”.</em></p>\r\n\r\n<p><strong>Thiết kế phù hợp với mọi hoàn cảnh</strong></p>\r\n\r\n<p><a href=\"https://sakos.vn/wp-content/uploads/2019/09/IMG_3843.jpg\" rel=\"lightbox-0\"><img alt=\"\" data-lazy-sizes=\"(max-width: 600px) 100vw, 600px\" data-lazy-src=\"https://sakos.vn/wp-content/uploads/2019/09/IMG_3843.jpg\" data-lazy-srcset=\"https://sakos.vn/wp-content/uploads/2019/09/IMG_3843.jpg 3295w, https://sakos.vn/wp-content/uploads/2019/09/IMG_3843-768x768.jpg 768w, https://sakos.vn/wp-content/uploads/2019/09/IMG_3843-300x300.jpg 300w, https://sakos.vn/wp-content/uploads/2019/09/IMG_3843-600x600.jpg 600w, https://sakos.vn/wp-content/uploads/2019/09/IMG_3843-100x100.jpg 100w\" data-was-processed=\"true\" height=\"600\" sizes=\"(max-width: 600px) 100vw, 600px\" src=\"https://sakos.vn/wp-content/uploads/2019/09/IMG_3843.jpg\" srcset=\"https://sakos.vn/wp-content/uploads/2019/09/IMG_3843.jpg 3295w, https://sakos.vn/wp-content/uploads/2019/09/IMG_3843-768x768.jpg 768w, https://sakos.vn/wp-content/uploads/2019/09/IMG_3843-300x300.jpg 300w, https://sakos.vn/wp-content/uploads/2019/09/IMG_3843-600x600.jpg 600w, https://sakos.vn/wp-content/uploads/2019/09/IMG_3843-100x100.jpg 100w\" width=\"600\" /></a></p>\r\n\r\n<p>Sự kết hợp hài hòa giữa giữa yếu tố truyền thống và hiện đại đã tạo nên siêu phẩm “vali quốc dân” thẩm mỹ cao, phù hợp với nhiều đối tượng khách hàng khác nhau. Phần thân vali vuông vức, bo gốc nhẹ mang vẻ đẹp khỏe khoắn kết hợp tinh tế với đường viền nhẹ nhàng, mềm mại tạo nên một chỉnh thể vali hoàn hảo.</p>\r\n\r\n<p><a href=\"https://sakos.vn/wp-content/uploads/2019/09/IMG_3845.jpg\" rel=\"lightbox-1\"><img alt=\"\" data-lazy-sizes=\"(max-width: 600px) 100vw, 600px\" data-lazy-src=\"https://sakos.vn/wp-content/uploads/2019/09/IMG_3845.jpg\" data-lazy-srcset=\"https://sakos.vn/wp-content/uploads/2019/09/IMG_3845.jpg 3295w, https://sakos.vn/wp-content/uploads/2019/09/IMG_3845-768x768.jpg 768w, https://sakos.vn/wp-content/uploads/2019/09/IMG_3845-300x300.jpg 300w, https://sakos.vn/wp-content/uploads/2019/09/IMG_3845-600x600.jpg 600w, https://sakos.vn/wp-content/uploads/2019/09/IMG_3845-100x100.jpg 100w\" data-was-processed=\"true\" height=\"600\" sizes=\"(max-width: 600px) 100vw, 600px\" src=\"https://sakos.vn/wp-content/uploads/2019/09/IMG_3845.jpg\" srcset=\"https://sakos.vn/wp-content/uploads/2019/09/IMG_3845.jpg 3295w, https://sakos.vn/wp-content/uploads/2019/09/IMG_3845-768x768.jpg 768w, https://sakos.vn/wp-content/uploads/2019/09/IMG_3845-300x300.jpg 300w, https://sakos.vn/wp-content/uploads/2019/09/IMG_3845-600x600.jpg 600w, https://sakos.vn/wp-content/uploads/2019/09/IMG_3845-100x100.jpg 100w\" width=\"600\" /></a></p>\r\n\r\n<p>Vali cần kéo thời trang SKYLINE được thiết kế từ chất liệu vải cao cấp Polyester và Nylon với khả năng trượt nước tốt, chống bám bụi, bền màu và hạn chế tác nhân trực tiếp từ bên ngoài, giúp chiếc vali của bạn luôn bền bỉ theo thời gian. Đây không chỉ là một chiếc vali được đánh giá cao từ những khách hàng khó tính nhất bởi tính thẩm mỹ mà còn vô cùng tiện lợi trong quá trình sử dụng.</p>\r\n\r\n<p>Từ sự sáng tạo cả đội ngũ thiết kế giàu kinh nghiệm cùng đôi bàn tay khéo léo của những người thợ lành nghề Sakos đã tạo ra một chiếc vali không chỉ mang tính thẩm mỹ cao mà còn vô cùng tiện lợi.</p>\r\n\r\n<p><strong>Sức chứa khủng</strong></p>\r\n\r\n<p>Điểm nổi bật của Sakos SKYLINE là tận dụng một cách tối đa không gian và có thể “ăn gian” thêm hành lý trong các chuyến đi.&nbsp;SKYLINE được chọn lọc kỹ lưỡng nguyên phụ liệu đầu vào đảm bảo các tiêu chí nghiêm ngặt từ Sakos.</p>\r\n\r\n<p><a href=\"https://sakos.vn/wp-content/uploads/2019/09/IMG_3847.jpg\" rel=\"lightbox-2\"><img alt=\"\" data-lazy-sizes=\"(max-width: 600px) 100vw, 600px\" data-lazy-src=\"https://sakos.vn/wp-content/uploads/2019/09/IMG_3847.jpg\" data-lazy-srcset=\"https://sakos.vn/wp-content/uploads/2019/09/IMG_3847.jpg 3203w, https://sakos.vn/wp-content/uploads/2019/09/IMG_3847-768x768.jpg 768w, https://sakos.vn/wp-content/uploads/2019/09/IMG_3847-300x300.jpg 300w, https://sakos.vn/wp-content/uploads/2019/09/IMG_3847-600x600.jpg 600w, https://sakos.vn/wp-content/uploads/2019/09/IMG_3847-100x100.jpg 100w\" data-was-processed=\"true\" height=\"600\" sizes=\"(max-width: 600px) 100vw, 600px\" src=\"https://sakos.vn/wp-content/uploads/2019/09/IMG_3847.jpg\" srcset=\"https://sakos.vn/wp-content/uploads/2019/09/IMG_3847.jpg 3203w, https://sakos.vn/wp-content/uploads/2019/09/IMG_3847-768x768.jpg 768w, https://sakos.vn/wp-content/uploads/2019/09/IMG_3847-300x300.jpg 300w, https://sakos.vn/wp-content/uploads/2019/09/IMG_3847-600x600.jpg 600w, https://sakos.vn/wp-content/uploads/2019/09/IMG_3847-100x100.jpg 100w\" width=\"600\" /></a></p>\r\n\r\n<p>Ngăn chính rộng, có hai đai cố định, giúp hành lý không bị xô lệch dù bị va đập mạnh trong quá trình di chuyển. Ngoài ra, Sakos SKYLINE còn có nhiều ngăn phụ giúp hành khách dễ dàng sắp xếp và phân chia hành lý.</p>\r\n\r\n<p><strong>Nhẹ gánh cho người dùng</strong></p>\r\n\r\n<p>Khóa TSA tiêu chuẩn Travel Sentry, giúp vali của bạn đi qua các điểm kiểm tra an ninh quốc tế trở nên đơn giản hơn. Dây kéo kép chống trộm, hạn chế tối đa tác động của các vật sắt nhọn. Hai lớp bảo vệ này giúp bạn hoàn toàn yên tâm trong mọi chuyến đi.</p>\r\n\r\n<p><a href=\"https://sakos.vn/wp-content/uploads/2019/09/IMG_3844.jpg\" rel=\"lightbox-3\"><img alt=\"\" data-lazy-sizes=\"(max-width: 600px) 100vw, 600px\" data-lazy-src=\"https://sakos.vn/wp-content/uploads/2019/09/IMG_3844.jpg\" data-lazy-srcset=\"https://sakos.vn/wp-content/uploads/2019/09/IMG_3844.jpg 3295w, https://sakos.vn/wp-content/uploads/2019/09/IMG_3844-768x768.jpg 768w, https://sakos.vn/wp-content/uploads/2019/09/IMG_3844-300x300.jpg 300w, https://sakos.vn/wp-content/uploads/2019/09/IMG_3844-600x600.jpg 600w, https://sakos.vn/wp-content/uploads/2019/09/IMG_3844-100x100.jpg 100w\" data-was-processed=\"true\" height=\"600\" sizes=\"(max-width: 600px) 100vw, 600px\" src=\"https://sakos.vn/wp-content/uploads/2019/09/IMG_3844.jpg\" srcset=\"https://sakos.vn/wp-content/uploads/2019/09/IMG_3844.jpg 3295w, https://sakos.vn/wp-content/uploads/2019/09/IMG_3844-768x768.jpg 768w, https://sakos.vn/wp-content/uploads/2019/09/IMG_3844-300x300.jpg 300w, https://sakos.vn/wp-content/uploads/2019/09/IMG_3844-600x600.jpg 600w, https://sakos.vn/wp-content/uploads/2019/09/IMG_3844-100x100.jpg 100w\" width=\"600\" /></a></p>\r\n\r\n<p>Cần kéo hợp kim nhôm thiết kế hình học siêu nhẹ, phần nút bấm bằng cao su tổng hợp dễ dàng điều chỉnh lên xuống chỉ bằng một cái “nhấn nút” nhẹ nhàng. Chiếc vali “quốc dân” SKYLINE dễ dàng hơn trong quá trình vận hành với hệ thống bánh xe chịu lực Hinomoto xoay 360◦ được bố trí đều trên 4 gốc, túi chứa dầu tự động kích hoạt trong quá trình bánh xe chuyển động.</p>\r\n\r\n<p><a href=\"https://sakos.vn/wp-content/uploads/2019/09/IMG_3846.jpg\" rel=\"lightbox-4\"><img alt=\"\" data-lazy-sizes=\"(max-width: 600px) 100vw, 600px\" data-lazy-src=\"https://sakos.vn/wp-content/uploads/2019/09/IMG_3846.jpg\" data-lazy-srcset=\"https://sakos.vn/wp-content/uploads/2019/09/IMG_3846.jpg 3285w, https://sakos.vn/wp-content/uploads/2019/09/IMG_3846-768x768.jpg 768w, https://sakos.vn/wp-content/uploads/2019/09/IMG_3846-300x300.jpg 300w, https://sakos.vn/wp-content/uploads/2019/09/IMG_3846-600x600.jpg 600w, https://sakos.vn/wp-content/uploads/2019/09/IMG_3846-100x100.jpg 100w\" data-was-processed=\"true\" height=\"600\" sizes=\"(max-width: 600px) 100vw, 600px\" src=\"https://sakos.vn/wp-content/uploads/2019/09/IMG_3846.jpg\" srcset=\"https://sakos.vn/wp-content/uploads/2019/09/IMG_3846.jpg 3285w, https://sakos.vn/wp-content/uploads/2019/09/IMG_3846-768x768.jpg 768w, https://sakos.vn/wp-content/uploads/2019/09/IMG_3846-300x300.jpg 300w, https://sakos.vn/wp-content/uploads/2019/09/IMG_3846-600x600.jpg 600w, https://sakos.vn/wp-content/uploads/2019/09/IMG_3846-100x100.jpg 100w\" width=\"600\" /></a></p>\r\n\r\n<p>Ưu điểm vượt trội của Sakos SKYLINE là khả năng chịu nhiệt cực tốt, bề mặt sáng màu, bền bỉ theo thời gian và không lo bị lỗi mốt.</p>', NULL, NULL, NULL, 1550000, 1600000, 1, 9, NULL, 9, NULL, 2, '2020-08-24 16:30:48', '2020-10-27 18:14:50', '2020-10-27 18:14:50', 0, 0, NULL, 1, 1, 1, 6, 1, NULL);
