INSERT INTO `lck_product` VALUES (5, NULL, '88', NULL, 'Cà Phê Sữa Đông Trùng Hạ Thảo 4 IN 1 (20 gói/hộp)', 'ca-phe-sua-dong-trung-ha-thao-4-in-1-20-goihop', NULL, 'Quy cách đóng gói: 18g/ gói – 20 gói/ hộp\r\nThành phần: Đông Trùng Hạ Thảo nguyên chất,  Đường, Bột kem cà phê, Cà phê hoà tan nguyên chất\r\nCông dụng: \r\nChống lão hoá tế bào\r\nNgăn ngừa ung thư\r\nSảng khoái mỗi ngày, Bồi bổ cơ thể, tăng cường sức khỏe cho người cơ thể suy nhược, mệt mỏi, ốm yếu, Giúp cơ thể tỉnh táo\r\nKhuyến cáo: Sản phẩm này không phải là thuốc, không có tác dụng thay thế thuốc chữa bệnh\r\nBảo quản: Bảo quản ở nơi khô mát, Tránh ánh sáng\r\nHướng dẫn sử dụng và bảo quản:\r\n\r\nHoà 1 gói với 80ml nước nóng và khuấy đều. Hoặc hoà 2 gói với 70ml nước nóng khuấy đều và thêm đá nếu muốn dùng lạnh.\r\nNgày dùng 1-2 lần.\r\nLIÊN HỆ TƯ VẤN: \r\nCÔNG TY CỔ PHẦN ĐÔNG TRÙNG HẠ THẢO HIMA\r\nCHUYÊN VIÊN TƯ VẤN SẢN PHẨM : MS.TRANG PHẠM\r\nSỐ ĐIỆN THOẠI: 094.209.1768\r\nEMAIL: pminhtrang2905@gmai.com', NULL, NULL, '<p><strong>Quy cách đóng gói:</strong>&nbsp;18g/ gói – 20 gói/ hộp</p>\r\n\r\n<p><strong>Thành phần:</strong>&nbsp;Đông Trùng Hạ Thảo nguyên chất,&nbsp; Đường, Bột kem cà phê, Cà phê hoà tan nguyên chất</p>\r\n\r\n<p><strong>Công dụng:</strong>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Chống lão hoá tế bào</li>\r\n	<li>Ngăn ngừa ung thư</li>\r\n	<li>Sảng khoái mỗi ngày, Bồi bổ cơ thể, tăng cường sức khỏe cho người cơ thể suy nhược, mệt mỏi, ốm yếu, Giúp cơ thể tỉnh táo</li>\r\n</ul>\r\n\r\n<p><strong>Khuyến cáo:&nbsp;</strong>Sản phẩm này không phải là thuốc, không có tác dụng thay thế thuốc chữa bệnh</p>\r\n\r\n<p><strong>Bảo quản:</strong>&nbsp;Bảo quản ở nơi khô mát, Tránh ánh sáng</p>\r\n\r\n<p><strong>Hướng dẫn sử dụng và bảo quản:</strong></p>\r\n\r\n<ul>\r\n	<li>Hoà 1 gói với 80ml nước nóng và khuấy đều. Hoặc hoà 2 gói với 70ml nước nóng khuấy đều và thêm đá nếu muốn dùng lạnh.</li>\r\n	<li>Ngày dùng 1-2 lần.</li>\r\n</ul>\r\n\r\n<p><strong>LIÊN HỆ TƯ VẤN:&nbsp;</strong></p>\r\n\r\n<p>CÔNG TY CỔ PHẦN ĐÔNG TRÙNG HẠ THẢO HIMA</p>\r\n\r\n<p>CHUYÊN VIÊN TƯ VẤN SẢN PHẨM : MS.TRANG PHẠM</p>\r\n\r\n<p>SỐ ĐIỆN THOẠI: 094.209.1768</p>\r\n\r\n<p>EMAIL: pminhtrang2905@gmai.com</p>', NULL, NULL, NULL, 187000, 187000, 1, 119, NULL, 119, NULL, 2, '2020-10-28 09:35:36', '2020-11-12 15:31:17', '2020-11-12 15:31:17', 1, 511, NULL, 1, 1, NULL, 0, 1, 1);
INSERT INTO `lck_product` VALUES (6, NULL, '87', NULL, 'ĐÔNG TRÙNG HẠ THẢO KHÔ', 'dong-trung-ha-thao-kho', 'Đông Trùng Hạ Thảo đã được đông y xưa lẫn nay ca ngợi như thần dược với nhiều lợi ích tuyệt vời. Đối với người cao tuổi, người vừa hết bệnh muốn phục hồi nhanh sức lực, người làm việc trí não, người thường xuyên căng thẳng,...việc sử dụng đông trùng hạ thảo sẽ mang lại rất nhiều lợi ích.\r\nƯu đãi: Mua 3 tặng 1 (tiết kiệm 910,000đ)\r\nQuy cách: 10g\r\nCách sử dụng: Dùng hãm trà, ngâm rượu, nấu cháo, món hầm\r\nBảo quản: trong ngăn mát tủ lạnh', 'Đông Trùng Hạ Thảo đã được đông y xưa lẫn nay ca ngợi như thần dược với nhiều lợi ích tuyệt vời. Đối với người cao tuổi, người vừa hết bệnh muốn phục hồi nhanh sức lực, người làm việc trí não, người thường xuyên căng thẳng,...việc sử dụng đông trùng hạ thảo sẽ mang lại rất nhiều lợi ích.\r\nƯu đãi: Mua 3 tặng 1 (tiết kiệm 910,000đ)\r\nQuy cách: 10g\r\nCách sử dụng: Dùng hãm trà, ngâm rượu, nấu cháo, món hầm\r\nBảo quản: trong ngăn mát tủ lạnh', NULL, NULL, '<h3 itemprop=\"description\">Đông Trùng Hạ Thảo đã được đông y xưa lẫn nay ca ngợi như thần dược với nhiều lợi ích tuyệt vời. Đối với người cao tuổi, người vừa hết bệnh muốn phục hồi nhanh sức lực, người làm việc trí não, người thường xuyên căng thẳng,...việc sử dụng đông trùng hạ thảo sẽ mang lại rất nhiều lợi ích.</h3>\r\n\r\n<h6>&nbsp;</h6>\r\n\r\n<h6><img src=\"https://kimcuongvang.com/landing/gift.gif\" /><strong>Ưu đãi: Mua 3 tặng 1 (tiết kiệm 910,000đ)</strong></h6>\r\n\r\n<h6><b>Quy cách</b>: 10g</h6>\r\n\r\n<h6><b>Cách sử dụng</b>: Dùng hãm trà, ngâm rượu, nấu cháo, món hầm</h6>\r\n\r\n<h6><b>Bảo quản:</b>&nbsp;trong ngăn mát tủ lạnh</h6>', NULL, NULL, NULL, 750000, 0, 1, 117, NULL, 117, NULL, 2, '2020-10-28 09:40:06', '2020-11-12 15:31:17', '2020-11-12 15:31:17', 1, 1, NULL, 1, 1, NULL, 0, 0, NULL);
INSERT INTO `lck_product` VALUES (7, NULL, '88,89', NULL, 'Cà phê Arabica nguyên chất 100%', 'ca-phe-arabica-nguyen-chat-100', NULL, NULL, NULL, NULL, '<h2>PASSION - Cà phê Cao cấp có giới hạn</h2>\r\n\r\n<h3>Giới thiệu:</h3>\r\n\r\n<p>Loại cà phê cao cấp, sản lượng giới hạn, 100% trái hái chín được lựa chọn, ủ lên men để có vị ngọt hậu êm dịu ở cổ. Được rang mộc chín vừa tới để giữ chất của hạt cà phê.</p>\r\n\r\n<p><img alt=\"\" src=\"https://file.hstatic.net/200000036176/file/nguyen_start_cafe-passion1_159be3cf09aa490486203be4d1230844_1024x1024.png\" /></p>\r\n\r\n<p>Cà phê Passion 100% quả được hái chín cho ngọt nguyên thủy của cà phê. Dùng phương pháp chế biến lên men Natural sau khi vừa hái để có hương thơm thuần khiết tự nhiên, cùng công thức rang chuyên biệt để ra loại thức uống an tâm và tỉnh táo.</p>\r\n\r\n<h3>Món quà hoàn hảo</h3>\r\n\r\n<p>Vị ngon của Passion có thể cảm nhận được từ bên ngoài khi được thiết kế đựng trong hộp giấy cao cấp, đường nét vuông vắn, chỉnh chu. Mang lại &nbsp;sự sang trọng mà vẫn giữ nét đơn giản</p>\r\n\r\n<p><img alt=\"\" src=\"https://file.hstatic.net/200000036176/file/nguyen_start_cafe-passion2_e4a495a849bf4791bba0b4195068f234_1024x1024.png\" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3>Sản phẩm</h3>\r\n\r\n<p>Nguyên Start Passion được&nbsp;đựng trong hộp sang trọng chinh chu, đựng trong&nbsp;2 gói trọng lượng 1kg/hộp.</p>\r\n\r\n<p>Thành phần:&nbsp;&nbsp;Phối trộn hạt Robusta lên men và hạt Arabica.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3>Cam kết 3 Không</h3>\r\n\r\n<ul>\r\n	<li>Không dùng hạt gì khác ngoài cà phê,&nbsp;100% loại cà phê thuần khiết.</li>\r\n	<li>Không chất bảo quản 100% Cà phê được rang mộc.</li>\r\n	<li>Không hương liệu&nbsp;</li>\r\n</ul>\r\n\r\n<p>Nguyên Start đền 200%&nbsp;nếu phát hiện&nbsp;có chất bảo quản, đậu nành, bắp, hương liệu, bơ, mùi nhân tạo.</p>\r\n\r\n<h3>Cách Pha:</h3>\r\n\r\n<p>&nbsp;<a href=\"https://nguyenstart.com/huong-dan-nhanh-cach-pha-ca-phe/\" target=\"_blank\">Vui lòng xem tại đây &gt;&gt;</a></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<blockquote>\r\n<p><strong>Hạn sử dụng: 06 tháng kể từ ngày sản xuất</strong></p>\r\n</blockquote>', NULL, NULL, NULL, 300000, 0, 1, 116, NULL, 116, NULL, 2, '2020-10-28 09:48:22', '2020-11-12 15:31:17', '2020-11-12 15:31:17', 1, 2, NULL, NULL, NULL, NULL, 0, 1, NULL);
